import { G } from "../action";

const initialState = {
    countries: []
};

const rootReducer = (state = initialState, action) => {
    switch (action.type) {
        case "ALL_POKEMONS":
            return {
                ...state
            }

        default:
            return state;
    }
};

export default rootReducer;
